import React from "react";

class Header extends React.Component {
  render() {
    const numberOfPaintings = this.props.numberOfPaintings;
    return (
      <h1 className="header">{`${this.props.numberOfPaintings} Paintings!`}</h1>
    );
  }
}

export default Header;
